import ExpenseItem from "./components/ExpenseItem";

function App() {
  let name = "Toilet Paper"
  return (
    <div>
      <h2>Let's get started!</h2>
      <ExpenseItem> {title=name} </ExpenseItem>
    </div>
  );
}

export default App;
